nt Creation</h3>\r\n\r\n<ul>\r\n	<li>You must create an account to make purchases on Shopy</li>\r\n	<li>You agree to provide accurate, current, and complete information</li>\r\n	<li>You are responsible for maintaining the confidentiality of your account credentials</li>\r\n	<li>You must notify us immediately of any unauthorized access or security breach</li>\r\n</ul>\r\n\r\n<h3>4.2 Account Responsibilities</h3>\r\n\r\n<ul>\r\n	<li>You are solely responsible for all activities conducted through your account</li>\r\n	<li>You may not share your account with others</li>\r\n	<li>You may not create multiple accounts for fraudulent purposes</li>\r\n	<li>We reserve the right to suspend or terminate accounts that violate these Terms</li>\r\n</ul>\r\n\r\n<h3>4.3 Account Termination</h3>\r\n\r\n<p>You may close your account at any time by contacting customer support. We may suspend or terminate your account if you violate these Terms or engage in fraudulent activity.</p>\r\n\r\n<hr />\r\n<h2>5. Products and Services</h2>\r\n\r\n<h3>5.1 Product Listings</h3>\r\n\r\n<ul>\r\n	<li>Product descriptions, images, and prices are provided by Sellers</li>\r\n	<li>We strive for accuracy but cannot guarantee that all information is error-free</li>\r\n	<li>Products are subject to availability</li>\r\n	<li>We reserve the right to limit quantities or refuse orders</li>\r\n</ul>\r\n\r\n<h3>5.2 Pricing</h3>\r\n\r\n<ul>\r\n	<li>All prices are displayed in the applicable currency</li>\r\n	<li>Prices may change without notice</li>\r\n	<li>We reserve the right to correct pricing errors</li>\r\n	<li>Additional fees (taxes, shipping) may apply and will be shown before checkout</li>\r\n</ul>\r\n\r\n<h3>5.3 Product Availability</h3>\r\n\r\n<ul>\r\n	<li>Products are subject to availability and may sell out</li>\r\n	<li>We do not guarantee that products will always be in stock</li>\r\n	<li>If a product becomes unavailable after ordering, we will notify you and offer a refund or replacement</li>\r\n</ul>