	(359, 'App\\Models\\DataSetting', 87, 'en', 'privacy_policy', '<h1>Privacy Policy for Shopy</h1>\r\n\r\n<p><strong>Last Updated:</strong> October 5, 2025</p>\r\n\r\n<h2>Introduction</h2>\r\n\r\n<p>Welcome to Shopy (&quot;we,&quot; &quot;our,&quot; or &quot;us&quot;). We are committed to protecting your privacy and ensuring the security of your personal information. This Privacy Policy explains how we collect, use, disclose, and safeguard your information when you use our mobile application and services.</p>\r\n\r\n<p>By using Shopy, you agree to the collection and use of information in accordance with this policy. If you do not agree with our policies and practices, please do not use our application.</p>\r\n\r\n<hr />\r\n<h2>1. Information We Collect</h2>\r\n\r\n<h3>1.1 Personal Information</h3>\r\n\r\n<p>When you create an account or use Shopy, we may collect:</p>\r\n\r\n<ul>\r\n	<li><strong>Account Information:</strong> Name, email address, phone number, password</li>\r\n	<li><strong>Profile Information:</strong> Profile picture, date of birth, gender (optional)</li>\r\n	<li><strong>Shipping Information:</strong> Delivery address, city, postal code, country</li>\r\n	<li><strong>Payment Information:</strong> Credit/debit card details, billing address (processed securely through third-party payment processors)</li>\r\n	<li><strong>Identity Verification:</strong> Government-issued ID (if required for certain transactions)</li>\r\n</ul>\r\n\r\n<h3>1.2 Transaction Information</h3>\r\n\r\n<ul>\r\n	<li>Order history and purchase details</li>\r\n	<li>Shopping cart contents</li>\r\n	<li>Product reviews and ratings</li>\r\n	<li>Wishlist items</li>\r\n	<li>Customer support communications</li>\r\n</ul>\r\n\r\n<h3>1.3 Technical Information</h3>\r\n\r\n<ul>\r\n	<li>Device information (model, operating system, unique device identifiers)</li>\r\n	<li>IP address and location data</li>\r\n	<li>Browser type and version</li>\r\n	<li>App usage data and analytics</li>\r\n	<li>Crash reports and performance data</li>\r\n	<li>Cookies and similar tracking technologies</li>\r\n</ul>\r\n\r\n<h3>1.4 Information from Third Parties</h3>\r\n\r\n<ul>\r\n	<li>Social media profile information (if you sign in using social media accounts)</li>\r\n	<li>Payment verification from payment processors</li>\r\n	<li>Delivery status from shipping partners</li>\r\n</ul>\r\n\r\n<hr />\r\n<h2>2. How We Use Your Information</h2>\r\n\r\n<p>We use the collected information for the following purposes:</p>\r\n\r\n<h3>2.1 Service Delivery</h3>\r\n\r\n<ul>\r\n	<li>Processing and fulfilling your orders</li>\r\n	<li>Managing your account and providing customer support</li>\r\n	<li>Sending order confirmations, shipping updates, and delivery notifications</li>\r\n	<li>Processing payments and preventing fraud</li>\r\n</ul>\r\n\r\n<h3>2.2 Personalization</h3>\r\n\r\n<ul>\r\n	<li>Providing personalized product recommendations</li>\r\n	<li>Customizing your shopping experience</li>\r\n	<li>Showing relevant offers and promotions</li>\r\n	<li>Remembering your preferences and settings</li>\r\n</ul>\r\n\r\n<h3>2.3 Communication</h3>\r\n\r\n<ul>\r\n	<li>Sending promotional emails and notifications (with your consent)</li>\r\n	<li>Responding to your inquiries and feedback</li>\r\n	<li>Conducting surveys and market research</li>\r\n	<li>Sending important updates about our services</li>\r\n</ul>\r\n\r\n<h3>2.4 Improvement and Analytics</h3>\r\n\r\n<ul>\r\n	<li>Analyzing app usage to improve our services</li>\r\n	<li>Identifying and fixing technical issues</li>\r\n	<li>Developing new features and functionality</li>\r\n	<li>Understanding customer behavior and trends</li>\r\n</ul>\r\n\r\n<h3>2.5 Legal and Security</h3>\r\n\r\n<ul>\r\n	<li>Complying with legal obligations</li>\r\n	<li>Protecting against fraud and unauthorized transactions</li>\r\n	<li>Enforcing our Terms of Service</li>\r\n	<li>Resolving disputes</li>\r\n</ul>\r\n\r\n<hr />\r\n<h2>3. Information Sharing and Disclosure</h2>\r\n\r\n<p>We do not sell your personal information. We may share your information with:</p>\r\n\r\n<h3>3.1 Service Providers</h3>\r\n\r\n<ul>\r\n	<li>Payment processors (Stripe, PayPal, etc.)</li>\r\n	<li>Shipping and delivery partners</li>\r\n	<li>Cloud storage providers</li>\r\n	<li>Analytics services (Firebase, Google Analytics)</li>\r\n	<li>Customer support tools</li>\r\n	<li>Marketing platforms</li>\r\n</ul>\r\n\r\n<h3>3.2 Business Partners</h3>\r\n\r\n<ul>\r\n	<li>Sellers and merchants on our platform</li>\r\n	<li>Advertising partners (with your consent)</li>\r\n</ul>\r\n\r\n<h3>3.3 Legal Requirements</h3>\r\n\r\n<p>We may disclose your information if required by law or in response to:</p>\r\n\r\n<ul>\r\n	<li>Court orders or legal processes</li>\r\n	<li>Government requests</li>\r\n	<li>Protection of our rights and safety</li>\r\n	<li>Investigation of fraud or security issues</li>\r\n</ul>\r\n\r\n<h3>3.4 Business Transfers</h3>\r\n\r\n<p>In the event of a merger, acquisition, or sale of assets, your information may be transferred to the new entity.</p>\r\n\r\n<hr />\r\n<h2>4. Data Security</h2>\r\n\r\n<p>We implement industry-standard security measures to protect your information:</p>\r\n\r\n<ul>\r\n	<li>Encryption of sensitive data (SSL/TLS)</li>\r\n	<li>Secure payment processing (PCI-DSS compliant)</li>\r\n	<li>Regular security audits and updates</li>\r\n	<li>Access controls and authentication</li>\r\n	<li>Secure data storage and backup systems</li>\r\n</ul>\r\n\r\n<p>However, no method of transmission over the internet is 100% secure. While we strive to protect your information, we cannot guarantee absolute security.</p>\r\n\r\n<hr />\r\n<h2>5. Your Rights and Choices</h2>\r\n\r\n<h3>5.1 Account Management</h3>\r\n\r\n<p>You have the right to:</p>\r\n\r\n<ul>\r\n	<li>Access your personal information</li>\r\n	<li>Update or correct your data</li>\r\n	<li>Delete your account</li>\r\n	<li>Export your data</li>\r\n</ul>\r\n\r\n<h3>5.2 Communication Preferences</h3>\r\n\r\n<p>You can:</p>\r\n\r\n<ul>\r\n	<li>Opt-out of promotional emails (unsubscribe link provided)</li>\r\n	<li>Manage push notification settings</li>\r\n	<li>Control SMS/text message preferences</li>\r\n</ul>\r\n\r\n<h3>5.3 Cookie Management</h3>\r\n\r\n<p>You can control cookies through your browser settings or app preferences.</p>\r\n\r\n<h3>5.4 Location Services</h3>\r\n\r\n<p>You can enable or disable location services in your device settings.</p>\r\n\r\n<h3>5.5 Data Portability</h3>\r\n\r\n<p>You can request a copy of your data in a portable format.</p>\r\n\r\n<hr />\r\n<h2>6. Data Retention</h2>\r\n\r\n<p>We retain your information for as long as necessary to:</p>\r\n\r\n<ul>\r\n	<li>Provide our services</li>\r\n	<li>Comply with legal obligations</li>\r\n	<li>Resolve disputes</li>\r\n	<li>Enforce our agreements</li>\r\n</ul>\r\n\r\n<p>When you delete your account, we will delete or anonymize your personal information within 30 days, except where retention is required by law.</p>\r\n\r\n<hr />\r\n<h2>7. Children&#39;s Privacy</h2>\r\n\r\n<p>Shopy is not intended for children under the age of 13 (or the applicable age of consent in your jurisdiction). We do not knowingly collect personal information from children. If you believe we have collected information from a child, please contact us immediately.</p>\r\n\r\n<hr />\r\n<h2>8. International Data Transfers</h2>\r\n\r\n<p>Your information may be transferred to and processed in countries other than your country of residence. We ensure appropriate safeguards are in place to protect your information in accordance with this Privacy Policy and applicable laws.</p>\r\n\r\n<hr />\r\n<h2>9. Third-Party Links</h2>\r\n\r\n<p>Our app may contain links to third-party websites or services. We are not responsible for the privacy practices of these external sites. We encourage you to review their privacy policies.</p>\r\n\r\n<hr />\r\n<h2>10. Changes to This Privacy Policy</h2>\r\n\r\n<p>We may update this Privacy Policy from time to time. We will notify you of significant changes by:</p>\r\n\r\n<ul>\r\n	<li>Posting the new policy in the app</li>\r\n	<li>Sending an email notification</li>\r\n	<li>Displaying an in-app notification</li>\r\n</ul>\r\n\r\n<p>Your continued use of Shopy after changes constitutes acceptance of the updated policy.</p>\r\n\r\n<hr />\r\n<h2>11. Contact Us</h2>\r\n\r\n<p>If you have questions, concerns, or requests regarding this Privacy Policy or your personal information, please contact us:</p>\r\n\r\n<p><strong>Shopy Support Team</strong></p>\r\n\r\n<ul>\r\n	<li><strong>Email:</strong> info@shopyapp.com</li>\r\n	<li><strong>Support Email:</strong> support@shopyapp.com</li>\r\n	<li><strong>Phone:</strong> +201111642205</li>\r\n	<li><strong>Address: Maadi</strong></li>\r\n	<li><strong>Website:</strong> https://shopyapp.site/</li>\r\n</ul>\r\n\r\n<p><strong>Response Time:</strong> We aim to respond to all inquiries within 48 hours.</p>\r\n\r\n<hr />\r\n<h2>12. Specific Regional Rights</h2>\r\n\r\n<h3>12.1 For European Union (GDPR)</h3>\r\n\r\n<p>If you are in the EU, you have additional rights under GDPR:</p>\r\n\r\n<ul>\r\n	<li>Right to access your data</li>\r\n	<li>Right to rectification</li>\r\n	<li>Right to erasure (&quot;right to be forgotten&quot;)</li>\r\n	<li>Right to restrict processing</li>\r\n	<li>Right to data portability</li>\r\n	<li>Right to object to processing</li>\r\n	<li>Right to withdraw consent</li>\r\n	<li>Right to lodge a complaint with a supervisory authority</li>\r\n</ul>\r\n\r\n<h3>12.2 For California Residents (CCPA)</h3>\r\n\r\n<p>California residents have the right to:</p>\r\n\r\n<ul>\r\n	<li>Know what personal information is collected</li>\r\n	<li>Know if personal information is sold or disclosed</li>\r\n	<li>Opt-out of the sale of personal information</li>\r\n	<li>Request deletion of personal information</li>\r\n	<li>Non-discrimination for exercising privacy rights</li>\r\n</ul>\r\n\r\n<h3>12.3 For Other Regions</h3>\r\n\r\n<p>We comply with applicable privacy laws in all jurisdictions where we operate.</p>\r\n\r\n<hr />\r\n<h2>13. Consent</h2>\r\n\r\n<p>By using Shopy, you consent to:</p>\r\n\r\n<ul>\r\n	<li>The collection and use of your information as described in this Privacy Policy</li>\r\n	<li>The transfer of your data as necessary to provide our services</li>\r\n	<li>Communications from us regarding your account and orders</li>\r\n</ul>\r\n\r\n<p>You can withdraw consent at any time by contacting us or adjusting your settings.</p>\r\n\r\n<hr />\r\n<p><strong>Thank you for trusting Shopy with your information. We are committed to protecting your privacy and providing you with a secure shopping experience.</strong></p>\r\n\r\n<hr />\r\n<p><em>This Privacy Policy is effective as of the date stated above and applies to all users of the Shopy mobile application.</em></p>', NULL, NULL),
